function generatePostTOC(b,f,d){var a=jQuery("<div id='postTOC'></div>");var e=jQuery("<ul id='mytoc'></ul>");var c=jQuery(b).first();if(f==undefined){f=2}if(d==undefined){d=2}a.append('<span class="tocHeading">Contents</span>');e.tableOfContents(c,{startLevel:f,depth:d});a.append(e);a.insertBefore(b)}function generateWikiTOC(c,b,g,e){var a=jQuery("<div id='wikiTOC' class='sidebar'></div>");var f=jQuery("<ul id='mytoc' class='nav sidenav' data-spy='affix' data-offset-top='150'></ul>");var d=jQuery(c).first();if(g==undefined){g=2}if(e==undefined){e=2}f.tableOfContents(d,{startLevel:g,depth:e});a.append(f);$(b).append(a)};